" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Classification of phalangeal condylar fractures",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 385px; height: 417px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Condylar fractures are classified into 3 types:",
"    <br>",
"     <ul>",
"      <li>",
"       Type I - Non-displaced unicondylar fractures",
"      </li>",
"      <li>",
"       Type II - Displaced unicondylar fractures",
"      </li>",
"      <li>",
"       Type III - Comminuted bicondylar fractures",
"      </li>",
"     </ul>",
"     <div class=\"footnotes\">",
"     </div>",
