var title_f23_9_23698="Crank test for SLAP lesion";
var content_f23_9_23698=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1124px;\">",
"  <div class=\"videoplayer\" h264=\"./images/EM/82885/Crank_test_video.mp4?title=Crank+test+for+SLAP+lesion\" style=\"width:480px;height:288px\">",
"  </div>",
"  <div class=\"figure\" style=\"width: 524px\">",
"   <div class=\"ttl\">",
"    Crank test for SLAP lesion",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 504px; height: 378px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    To perform the crank test, the patient abducts their arm 160 degrees while keeping the arm in the plane of the scapula. The elbow is flexed 90 degrees. The examiner then applies an axial load to the humerus with one hand while rotating the arm internally and externally with the other. Pain, a clicking sensation during the maneuver, or reproduction of symptoms similar to those experienced at work or sport indicates a positive test.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Stephen Simons, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
