" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Electrical alternans",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 408px; height: 360px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Sinus tachycardia with electrical alternans which is characterized by beat-to-beat alternation in the QRS appearance (best seen in leads V2 to V4). These findings are strongly suggestive of pericardial effusion, usually with tamponade. The alternating ECG pattern is related to back-and-forth swinging motion of the heart in the pericardial fluid.",
"    <div class=\"footnotes\">",
