var title_f23_9_23707="Newborn resuscitation drugs";
var content_f23_9_23707=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F55367&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F55367&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Medications used in neonatal resuscitation",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Medication",
"       </td>",
"       <td class=\"subtitle1\">",
"        Action",
"       </td>",
"       <td class=\"subtitle1\">",
"        Indication",
"       </td>",
"       <td class=\"subtitle1\">",
"        Dose and route",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Epinephrine",
"       </td>",
"       <td>",
"        Increases cardiac output by increasing the heart rate and myocardial contractility, increases blood pressure by causing peripheral vasoconstriction",
"       </td>",
"       <td>",
"        Heart rate &lt;60 per minute despite adequate ventilation and chest compressions",
"       </td>",
"       <td>",
"        <p>",
"         0.1-0.3 mL/kg IV",
"        </p>",
"        <p>",
"         0.3 to 1 mL/kg ET",
"        </p>",
"        <p>",
"         1:10,000 solution (concentration 0.1 mg/mL)",
"        </p>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Isotonic saline",
"       </td>",
"       <td>",
"        Increases intravascular volume",
"       </td>",
"       <td>",
"        Suspected hypovolemia",
"       </td>",
"       <td>",
"        10 mL/kg of 0.9 percent saline solution IV over 5 to 10 minutes",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Sodium bicarbonate",
"       </td>",
"       <td>",
"        Corrects metabolic acidosis",
"       </td>",
"       <td>",
"        Not recmomended for routine use. Has been used in cases of metabolic acidosis, and should only be given after adequate ventilation and circuation have been established.",
"       </td>",
"       <td>",
"        1 or 2 mEq/kg slow IV administration at a rate no faster than 1 mEq/kg per minute",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     IV: intravenous; ET: endotracheal.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
